import React from 'react';
import { AppBar, Button, Card, CardActions, CardContent, CardMedia, CssBaseline, Container, Grid, Toolbar, Typography } from "@material-ui/core";

function About() {
    return (
        <div style={{ marginTop: '150px' }}>
            <Typography variant='h2' align='center'>CHI SIAMO</Typography>
            <Typography variant='h5' align='center'>I fioi della descrizione</Typography>
        </div>
    )
}

export default About;
